      "Copilot": "Bintang melambangkan energi harapan, pembaruan.\nDan bimbingan ilahiâ€”itu adalah kartu inspirasi dan penyembuhan, mengingatkan kita bahwa setelah kekacauan datanglah kejelasan, kedamaian.\nDan janji akan cakrawala yang lebih cerah. Esensinya adalah tentang berhubungan kembali dengan iman, percaya pada aliran kehidupan.\nDan membiarkan optimisme menerangi jalan ke depan. ğŸ’– Dalam Cinta, Bintang mendorong kerentanan dan keterbukaan; jika lajang, ini berarti melepaskan luka masa lalu dan menjalin hubungan baru dengan kepercayaan dan keaslian.\nDalam hubungan, hal ini membutuhkan penyembuhan dan pembaruanâ€”seperti mempraktikkan pengampunan, menghidupkan kembali keintiman melalui mimpi bersama, atau menciptakan ruang untuk kejujuran emosional yang memulihkan keharmonisan. ğŸ’¼ Dalam Karir, The Star menyoroti visi dan inspirasi sebagai kekuatan penuntun; hal ini bisa berarti mengejar pekerjaan yang sejalan dengan tujuan Anda yang lebih tinggi, menerima proyek kreatif yang mengangkat semangat orang lain, atau memercayai bahwa peluang akan muncul ketika Anda tetap fokus pada tujuan jangka panjangâ€”baik dengan berjejaring dengan orang-orang yang berpikiran sama, menyempurnakan keterampilan Anda, atau membiarkan hasrat Anda memandu pilihan profesional. ğŸ’° Dalam Kekayaan, Bintang menasihati kesabaran dan keyakinan pada kemajuan bertahap; penyembuhan finansial mungkin diperlukan, seperti pemulihan dari kemunduran atau kebiasaan restrukturisasi, namun kartu ini memastikan bahwa dengan upaya dan optimisme yang konsisten, stabilitas dan kelimpahan akan kembaliâ€”langkah praktisnya termasuk menetapkan tujuan tabungan yang realistis, berinvestasi di bidang yang selaras dengan nilai-nilai Anda.\nDan menumbuhkan rasa syukur atas apa yang sudah dimiliki. âœ¨ Pada akhirnya, The Star adalah mercusuar pemberi semangat, menegaskan hal itu dengan merangkul harapan, keaslian.\nDan pembaruan, Anda dapat menciptakan kehidupan yang harmonis dan memuaskan. ğŸŒ¿ Percayalah pada visi Anda, peliharalah semangat Anda.\nDan ketahuilah bahwa cahaya di depan akan membimbing Anda menuju kesuksesan abadi dalam cinta dan karier.\nDan kesejahteraan finansial.",
      "Llama": "Bintang adalah representasi dari arketipe harapan, inspirasi.\nDan panduan batin ditemukan di berbagai dek tarot yang berasal dari kartu alegoris abad ke-15 yang dibuat oleh okultis Prancis dan kemudian dipopulerkan oleh dek Rider-Waite-Smith (RWS) karya Arthur Edward Waite. Kartu ini melambangkan energi penyembuhan, pembaruan.\nDan potensi positif.\n\n Bintang melambangkan benda angkasa yang melambangkan cahaya penuntun intuisi, kebijaksanaan batin.\nDan kesadaran yang lebih tinggi. Ini menandakan kepercayaan pada hubungan seseorang dengan sistem bimbingan batinnya dan alam semesta, yang mengarah pada peningkatan keyakinan terhadap perkembangan alami kehidupan.\n\nğŸ’– Cinta: Pengabdian yang Andal dan Masa Depan Emas\n Kartu ini menyarankan untuk memercayai intuisi emosional dan kebijaksanaan batin Anda saat menjalani hubungan romantis atau membuat keputusan yang memengaruhi cinta. Dengarkan bisikan hati Anda dan ikuti kompas batin Anda untuk kepuasan jangka panjang.\n\nğŸ’¼ Karier: Puncak Penguasaan Profesional\n The Star menyarankan untuk menyelaraskan diri Anda dengan panggilan sejati Anda, melakukan aktivitas dan pekerjaan yang selaras dengan nilai-nilai Anda dan memicu inspirasi batin. Peliharalah rasa memiliki tujuan dengan mendengarkan bimbingan batin Anda dan mengikuti arahannya.\n\nğŸ’° Kekayaan: Kebebasan Finansial Total dan Warisan Abadi\n Kartu ini menunjukkan menumbuhkan pandangan optimis terhadap masalah keuangan, mempercayai kelimpahan alam semesta.\nDan mempertahankan pola pikir yang berfokus pada memberi kembali dan berbagi sumber daya dengan orang lain. Sadarilah bahwa kemakmuran Anda terkait dengan penyebaran kegembiraan dan nilai."
