      "Llama": "Bulan adalah representasi dari pola dasar ilusi, intuisi.\nDan pengetahuan batin ditemukan di berbagai dek tarot yang berasal dari kartu alegoris abad ke-15 yang dibuat oleh okultis Prancis dan kemudian dipopulerkan oleh dek Rider-Waite-Smith (RWS) karya Arthur Edward Waite. Kartu ini melambangkan energi ketidakpastian, kebingungan.\nDan meningkatkan sensitivitas.\n\n Bulan mewakili keadaan pikiran bawah sadar yang cair dan seperti mimpi di mana pemikiran rasional terbatas.\nDan emosi, naluri.\nDan intuisi menjadi lebih dominan. Ini menandakan kebutuhan untuk menavigasi ambiguitas, ilusi.\nDan ketidakpastian dengan kejelasan dan kebijaksanaan.\n\nğŸ’– Cinta: Pengabdian yang Andal dan Masa Depan Emas\n Kartu ini menyarankan untuk memercayai intuisi Anda saat menghadapi situasi atau hubungan emosional yang kompleks. Sadarilah bahwa cinta bisa diselimuti misteri. ikuti firasat Anda daripada alasan rasional.\n\nğŸ’¼ Karier: Puncak Penguasaan Profesional\n Bulan menyarankan untuk berhati-hati terhadap informasi, rumor, atau kesalahpahaman yang menyesatkan tentang dunia profesional. Percayai naluri Anda dan gunakan kebijaksanaan kritis untuk membuat keputusan berdasarkan kesan halus dan pengetahuan batin.\n\nğŸ’° Kekayaan: Kebebasan Finansial Total dan Warisan Abadi\n Kartu ini menunjukkan kewaspadaan terhadap potensi jebakan keuangan dan risiko tersembunyi karena kurangnya pengetahuan atau pengambilan keputusan yang buruk. Latih kesadaran intuitif ketika berurusan dengan keuangan dan ikuti terus tren pasar yang tidak kentara."
