      "Llama": "Tiga Piala adalah representasi dari pola dasar emosi, kegembiraan.\nDan perayaan ditemukan di berbagai dek tarot yang berasal dari kartu alegoris abad ke-15 yang dibuat oleh okultis Prancis dan kemudian dipopulerkan oleh dek Rider-Waite-Smith (RWS) karya Arthur Edward Waite. Kartu ini melambangkan energi kegembiraan, persahabatan.\nDan hubungan komunal.\n\n Three of Cups menggambarkan tiga wanita dalam sebuah lingkaran, merayakan bersama, sering kali dikaitkan dengan kesatuan feminin, persaudaraan.\nDan pertemuan yang menyenangkan.\n\nğŸ’– Cinta: Pengabdian yang Andal dan Masa Depan Emas\n Kartu ini menyarankan untuk memelihara hubungan emosional Anda dengan memprioritaskan waktu berkualitas bersama orang-orang terkasih, membangun hubungan yang bermakna melalui aktivitas bersama.\nDan mengakui pentingnya hubungan sosial untuk kesejahteraan secara keseluruhan.\n\nğŸ’¼ Karier: Puncak Penguasaan Profesional\n Three of Cups menyarankan untuk menciptakan lingkungan kerja yang mendukung dengan membina persahabatan di tempat kerja, merayakan keberhasilan rekan kerja.\nSerta membangun rasa memiliki untuk meningkatkan kepuasan dan motivasi kerja.\n\nğŸ’° Kekayaan: Kebebasan Finansial Total dan Warisan Abadi\n Kartu ini menunjukkan pengakuan atas nilai kekayaan masyarakat dan dukungan keuangan melalui sumber daya bersama, investasi kelompok, atau usaha koperasi yang mendorong kesejahteraan kolektif."
