      "DeepSeek": "Empat Piala menandakan kondisi psikologis penarikan diri yang apatis dan ketidakpuasan kontemplatif setelah keterlibatan komunal dari Tiga Piala.\nRisiko utama adalah stagnasi ganas:\nğŸ’– Cinta: kebencian emosional mengarah pada pengabaian pasif terhadap pasangannya, yang menjadi bagian dari lanskap yang tidak dihargai, sementara subjek berfantasi tentang alternatif yang diidealkan dan tidak terlihat, yang menjamin kerusakan relasional.\nğŸ’¼ Karir: penolakan mendalam terhadap peluang yang ada akan melahirkan kebencian dan kegagalan kinerja yang pasif-agresif, membuat seseorang rentan terhadap keusangan dan menolak membangun keterampilan atau menyusun strategi untuk keluar.\nğŸ’° Kekayaan: penolakan untuk secara aktif mengelola atau menginvestasikan kembali aset yang ada karena mentalitas meremehkan \"itu saja tidak cukup\" menyebabkan penggabungan yang tidak tepat dan erosi nilai secara diam-diam melalui inflasi atau pengabaian.\nğŸ [Potensi Hadiah]\n kejelasan yang tajam:\nğŸ’– Cinta: jeda krusial yang memungkinkan pembedaan antara kebutuhan sejati dan sekadar kebosanan, yang berpotensi menyelamatkan hubungan dari momentum hampa atau mendorong akhir yang sadar, bukan reaktif.\nğŸ’¼ Karir: momen penilaian diri yang jujur â€‹â€‹yang mengungkapkan ketidakselarasan antara pekerjaan dan nilai-nilai batin, menciptakan ruang untuk pengalihan yang otentik.\nğŸ’° Kekayaan: penolakan secara disiplin terhadap peluang yang kurang optimal atau tidak selaras, menjaga modal untuk investasi yang benar-benar beresonansi.\nIni adalah introspeksi yang perlu, meski berbahaya.",
      "Perplexity": "Four of Cups, pip Air keempat di Rider-Waite-Smith, Marseille.\nDan tradisi Thoth Minor Arcana, mewujudkan sikap apatis kontemplatif, menolak peluang.\nDan penarikan diri secara introspektif sebelum pembaruan emosional.\nğŸ’– Cinta: Pengabdian yang Andal dan Masa Depan Emas\n\nDalam cinta, Four of Cups menandakan stagnasi emosionalâ€”ketidaktertarikan mengaburkan hubungan yang menjanjikan, atau meditasi tentang luka masa lalu menghalangi kerentanan baru.\nPara lajang mengabaikan pelamar halus yang tenggelam dalam lamunan.\npasangan menghadapi kebosanan relasional yang membutuhkan introspeksi jujur â€‹â€‹untuk menyalakan kembali gairah.\nSecara spiritual, hal ini mengundang sabat hati, di mana kontemplasi melarutkan kekecewaan ke dalam keterbukaan yang diperbarui.\n\nğŸ’¼ Karier: Puncak Penguasaan Profesional\n\nAgar sukses, Four of Cups memperingatkan prospek yang terabaikanâ€”tawaran emas datang tanpa disadari di tengah ketidakpuasan terhadap peran atau usaha saat ini.\nJeda introspeksi karir mengungkap jalan tersembunyi di bidang kreatif.\nsikap apatis berisiko mengalami stagnasi.\nPengetahuan tarot menggambarkan sosoknya yang menarik diri sebagai penolakan yang diperlukan, membuka ruang untuk kelimpahan yang selaras di luar kilau permukaan.\n\nğŸ§  Pola Pikir: Kebijaksanaan dan Pertumbuhan Batin\n\nFour of Cups memupuk keheningan yang tajam, mempertanyakan keinginan sambil menyelaraskan ke dalam untuk membedakan kepuasan sejati dari ketidakpuasan yang biasa terjadi.\nAnggaplah penolakan meditatif sebagai kebijaksanaan.\ncawan yang tak terlihat menunggu kebangkitan penerimaan.\nPola dasar ini membangkitkan kearifan spiritual, mengubah sikap apatis menjadi kedaulatan emosional yang mempunyai tujuan.",
      "Copilot": "Four of Cups melambangkan energi introspeksi, ketidakpuasan.\nDan evaluasi ulangâ€”itu adalah kartu jeda emosional, yang menandakan momen ketika peluang mungkin terabaikan karena gangguan, ketidakpuasan, atau kurangnya rasa syukur. Esensinya menunjukkan kontemplasi, kebutuhan untuk menilai kembali prioritas.\nDan pentingnya mengubah perspektif untuk mengenali berkah yang mungkin sudah ada. ğŸ’– Dalam Cinta, Empat Piala menunjukkan periode penarikan diri atau ketidakpuasan emosional; jika lajang, ini memperingatkan agar tidak menutup diri terhadap calon pasangan karena kekecewaan di masa lalu, mendesak Anda untuk tetap terbuka terhadap kemungkinan-kemungkinan baru yang mungkin tidak sesuai dengan harapan Anda biasanya.\nDalam hubungan, hal ini menyoroti pentingnya mengatasi stagnasi emosionalâ€”langkah praktisnya mencakup memulai percakapan yang jujur, menghidupkan kembali keintiman melalui pengalaman bersama.\nDan praktikkan rasa syukur atas hubungan yang sudah Anda miliki daripada berfokus pada apa yang dirasa kurang. ğŸ’¼ Dalam Karir, kartu ini menandakan pelepasan diri atau kurangnya motivasi; hal ini bisa berarti merasa tidak terinspirasi oleh pekerjaan saat ini atau mengabaikan peluang untuk berkembang karena hal tersebut tidak sesuai dengan harapan Andaâ€”nasihat yang dapat ditindaklanjuti adalah dengan menilai kembali tujuan Anda, mencari proyek yang dapat membangkitkan kembali semangat Anda.\nDan bersedia untuk mengeksplorasi jalur tidak konvensional yang mungkin mengarah pada kepuasan. ğŸ’° Dalam Kekayaan, Empat Piala menasihati agar berhati-hati terhadap ketidakpuasan atau pengabaian; peluang finansial mungkin ada tetapi diabaikan karena gangguan atau ekspektasi yang tidak realistisâ€”langkah praktisnya termasuk meninjau kembali kebiasaan finansial Anda, menghargai stabilitas yang Anda miliki.\nDan mempertimbangkan peluang yang terabaikan seperti investasi kecil, rencana tabungan, atau aliran pendapatan kreatif yang dapat terus tumbuh seiring waktu. âœ¨ Pada akhirnya, Empat Piala adalah kartu kebangkitan dan perspektif, yang menegaskan bahwa dengan mengalihkan fokus dari apa yang terasa tidak ada ke apa yang tersedia, Anda dapat menemukan kembali kepuasan dalam cinta, karier.\nDan kehidupan finansial. ğŸŒ¿ Percayalah bahwa kejelasan akan datang melalui refleksi.\nDan ketahuilah bahwa peluang untuk pembaharuan dan pertumbuhan lebih dekat daripada yang terlihat.",
      "Llama": "Empat Piala adalah representasi dari pola dasar introspeksi, kontemplasi.\nDan penilaian emosional ditemukan di berbagai dek tarot yang berasal dari kartu alegoris abad ke-15 yang dibuat oleh okultis Prancis dan kemudian dipopulerkan oleh dek Rider-Waite-Smith (RWS) karya Arthur Edward Waite. Kartu ini melambangkan energi refleksi, kesadaran diri.\nDan bimbingan batin.\n\n Four of Cups menggambarkan sosok yang duduk di meja dengan empat cangkir di depannya, sering dikaitkan dengan introspeksi, keseimbangan emosional.\nDan penilaian diri.\n\nğŸ’– Cinta: Pengabdian yang Andal dan Masa Depan Emas\n Kartu ini menyarankan meluangkan waktu untuk refleksi pribadi dalam hubungan romantis untuk mengidentifikasi area yang perlu diperbaiki, mengakui emosi dan kebutuhan Anda sendiri.\nDan mengambil keputusan berdasarkan kesadaran diri, bukan ekspektasi eksternal.\n\nğŸ’¼ Karier: Puncak Penguasaan Profesional\n Four of Cups menyarankan untuk menilai tujuan dan prioritas profesional Anda dengan mengevaluasi motivasi dan nilai-nilai Anda, meluangkan waktu untuk introspeksi untuk menemukan apa yang benar-benar memuaskan Anda.\nDan menyelaraskan jalur karier Anda dengan tujuan batin Anda.\n\nğŸ’° Kekayaan: Kebebasan Finansial Total dan Warisan Abadi\n Kartu ini menunjukkan pengakuan atas nilai tabungan emosional dan penganggaran untuk pertumbuhan pribadi melalui investasi dalam perawatan diri, pendidikan, atau pengembangan keterampilan yang mendorong stabilitas keuangan jangka panjang."
